import { BrowserRouter as Router, Route, Link , Switch,BrowserHistory } from 'react-router-dom';


export default class Home extends React.Component {
  render(){
    return (
      <div>
      <div className="bg">
      <Container style={{color: 'white', paddingTop: '3rem'}}>
         <h3>Welcome</h3>
         <br/>
         <p>The air we breathe is becoming increasingly polluted.
         <br/>Click around to learn more.
         <br/>
         <br/>Find out about how your air is,
         <br/>And don't forget to â€¦ </p>
      </Container>
      </div>
      <Jumbotron fluid>
      <Container>
          <h1 className="display-3">About</h1>
          <div>
          The purpose of this site is to inform people about how air quality can affect health. We hope that the general public can
          find out the quality for a location on a given day, related health risks, as well as an overview of air quality over a larger geographic span.
          By integrating this disparate data, people can use this information before traveling and prepare for adverse air conditions.
          </div>
          <br/>
      </Container>
      </Jumbotron>
      </div>
    );
  }
}
